@Override
public int hashCode() {
  int result = super.hashCode();
  long temp = Double.doubleToLongBits(latitude);
  result = 31 * result + (int) (temp ^ (temp >>> 32));
  temp = Double.doubleToLongBits(longitude);
  result = 31 * result + (int) (temp ^ (temp >>> 32));
  return result;
}

